	add("squib", "{\"term\":\"squib\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{unk.|title\u003dPossibly|lang\u003den}} imitative of a small explosion.\u0026lt;ref\u0026gt;Online Etymology Dictionary, [http://www.etymonline.com/index.php?term\u003dsquib Squib], accessed 2009-07-21.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small firework that is intended to spew sparks rather than explode\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"English Navy \u0027\u0027squibs\u0027\u0027 set fire to two dozen enemy ships in a Dutch harbor during the 16th century battle against the Spanish Armada\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Blackston\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The making and selling of fireworks and \u0027\u0027squibs\u0027\u0027 is punishable\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A similar device used to ignite an explosive or launch a rocket, etc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A kind of slow match or safety fuse\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Any small firecracker sold to the general public. Usually available in special clusters designed to explode in series after a single master fuze is lit\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The heating element used to set off the sodium azide pellets in a vehicle\u0027s airbag\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A small explosive used to replicate a bullet hitting a surface\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A short piece of witty writing; a lampoon\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Goldsmit\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"who copied his \u0027\u0027squibs\u0027\u0027, and re-echoed his jokes\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A writer of lampoons\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Tatle\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027squibs\u0027\u0027 are those who in the common phrase of the world are called libellers, lampooners, and pamphleteers\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"In a legal casebook, a short summary of a legal action placed between more extensively quoted cases\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A short article, often published in journals, that introduces theoretically problematic empirical data or discusses an overlooked theoretical problem. In contrast to a typical article, a squib need not answer the questions that it poses\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, William J. Idsardi, \u0027[http://www.biolinguistics.eu/index.php/biolinguistics/article/view/41/66 Combinatorics for Metrical Feet]\u0027, in Biolinguistics Vol 2, No\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"In this \u0027\u0027squib\u0027\u0027 I will prove that the number of possible metrical parsings into feet under these assumptions […\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"An unimportant, paltry, or mean-spirited person\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Spenser, Mother Hubberds Tale ll. 369-371\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"Its a hard case when men of good deserving / must either driven be perforce to sterving / or asked for their pas by everie squi\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"A sketched concept or visual solution, usually very quick and not too detailed. A word most commonly used within the Graphic Design industry\", \"priority\":23}]}, \"synonyms\":{}}");

	add("squick", "{\"term\":\"squick\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Seemingly phonaesthetic, formed of \u0027squ-\u0027 as in \u0027lang\u003den\u0027 and \u0027-ick\u0027 as in \u0027lang\u003den\u0027 Originated in the Usenet newsgroup alt.sex.bondage; popularized primarily in the newsgroup alt.tasteless.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A source of individual psychological discomfort. That which makes one \u0026quot;squirm and say ick.\u0026quot\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Jo Leigh, \u0027Scent of a Woman\u0027, page 82\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One man\u0027s turn-on is another\u0027s \u0027\u0027squick\u0027\u0027. But, if she chickened out now, the whole plan would fall apart\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Ken MacLeod, \u0027Newton\u0027s Wake: A Space Opera\u0027, page 88\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"We maintain, as you did in your time, the cultural \u0027\u0027squick\u0027\u0027 about internal interfaces with networked machinery, and about data capture, for obvious reasons\", \"priority\":5}]}, \"synonyms\":{}}");

	add("squiggle", "{\"term\":\"squiggle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a short twisting or wiggling line or mar\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1939\u0027\u0027, Flora Thompson, \u0027Lark Rise\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Even the cold ashes where a gipsy\u0027s fire had been sent little \u0027\u0027squiggles\u0027\u0027 of fear down Laura\u0027s spine, for how could she know that they were not still lurking near with designs upon her own person\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the tild\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"an illegible scrawl\", \"priority\":5}]}, \"synonyms\":{}}");

	add("squillion", "{\"term\":\"squillion\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"See {{suffix||illion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very large, unspecified number (of\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, Fynn, \u0027Mister God, This Is Anna\u0027, Ballantine Books (2000), ISBN 0345441559, [http://books.google.com/books?id\u003d-eO4gcu7SBYC\u0026amp;pg\u003dPA103 pages 102-103\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The word \u0027million\u0027 was adequate for most things, \u0027billion\u0027 came in handy on occasions, but if you wanted to use a word for a very, very large number, you just had to invent one. Anna invented one: a \u0027\u0027\u0027squillion\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, w:Terry Terry Pratchett, \u0027Eric\u0027, page 138\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"You thinks to yourself, ‘There’s a billion, trillion \u0027\u0027squillion\u0027\u0027 of them, no one’s going to notice.’ But that’s where professionalism comes in, sort of thing\", \"priority\":5}]}, \"synonyms\":{}}");

