	add("squirmage", "{\"term\":\"squirmage\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|squirm|age|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of squirming\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Harry Sanderford, \u0026quot;[http://prairiehome.publicradio.org/features/first_person/2007/05/09_sanderford.shtml A Bedtime Story]\u0026quot;, \u0027A Prairie Home Companion\u0027, 9 May 2007\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In bed, Lauren has never been able to control her lateral \u0027\u0027squirmage\u0027\u0027. She is the needle on a compass and Spencer is due North\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The condition or quality of causing a state of discomfort, particularly disgust, fear, or embarrassment\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"c. 2005\u0027\u0027, Angus Wolfe Murray, [http://www.eyeforfilm.co.uk/reviews.php?film_id\u003d11491 \u0027Waiting…\u0027 review], \u0027Eye for Film\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Pants down gags are as loud and lively as fart jokes, but willy waving in a restaurant kitchen is a whole new area of \u0027\u0027squirmage\u0027\u0027, hitherto unexplored\", \"priority\":6}]}, \"synonyms\":{}}");

	add("squirrel", "{\"term\":\"squirrel\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"French\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) {{m|enm|squirel}}, {{m|enm|squyrelle}}, from Anglo-norman {{m|fro|esquirel}} and Old french (842-ca. 1400) {{m|fro|escurel}} (whence French {{m|fr|écureuil}}), from {{m|la|scuriolus}}, diminutive of {{m|la|scurius}}, variant of Latin {{m|la|sciurus}}, from Ancient greek (to 1453) {{m|grc|σκίουρος}}. Displaced native Middle english (1100-1500) {{m|enm|aquerne}}, from Old english (ca. 450-1100) {{m|ang|ācweorna}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the rodents of the family Sciuridae distinguished by their large bushy tail\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person, usually a freezoner, who applies L. Ron Hubbard\u0027s technology in a heterodox manner\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One of the small rollers of a carding machine which work with the large cylinder\", \"priority\":3}]}, \"synonyms\":{}}");

	add("squirt", "{\"term\":\"squirt\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"low german\"], \"text\":\"From Middle english (1100-1500) \u0027squirten\u0027 of unknown origin. Akin to \u0027swirl\u0027 Compare Low german \u0027swirtjen\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An instrument from which a liquid is forcefully ejected in a small, quick stream\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A small, quick stream; a jet\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Peter Elst, Sas Jacobs, \u0027Object-Oriented ActionScript 3.0\u0027, %22squirts%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d63u4aASS5E\u0026amp;sig\u003dyvEzpHVcDtLB0UyspuYiiQXLpRg\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d3ytjUNSUAY3jmAXWwoDgCQ\u0026amp;redir_esc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"%22squirts%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 9\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Chances are you′ll get a \u0027\u0027squirt\u0027\u0027 of citrus juice in your eye\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The whole system of flow in the vicinity of a source\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An annoyingly pretentious person; a whippersnapper\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1946\u0027\u0027, w:Robert Penn Robert Penn Warren, \u0027w:All the King\u0027s All the King′s Men\u0027, 2005, %22squirts%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dHH0K0tOzVM\u0026amp;sig\u003dssNzfvqUojeMBp9duQmn9PZzUhE\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGjNjUPq8FoT5mAWS3YHQBQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"%22squirts%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 606\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"He was still there when I came up, a \u0027\u0027squirt\u0027\u0027 with his hat over one eye and a camera hung round his neck and a grin on his \u0027\u0027squirt\u0027\u0027 face. I thought maybe I had seen him around town, but maybe not, the \u0027\u0027squirts\u0027\u0027 look so much alike when they grind them out of journalism school\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A small child\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Hey \u0027\u0027squirt\u0027\u0027! Where you been\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027, Alethea Helbig, Agnes Perkins, \u0027Cutlass Island\u0027, entry in \u0027Dictionary of American Children′s Fiction, 1960-1984: Recent Books of Recognized Merit\u0027, %22squirts%22+child+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003drpEh0nj9di\u0026amp;sig\u003dwBLeyBhcl5G_jgF_yToR3coqw4o\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ddCFkUNyOGeTsmAWQrYHYDA\u0026amp;redir_esc\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"%22squirts%22%20child%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 137\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Hurd returns with Mal, Mr. Eph, and Gumbo, the “town \u0027\u0027squirt\u0027\u0027” of twelve, and the boys′ activities come out\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Karen Witemeyer, \u0027A Tailor-Made Bride\u0027, Bethany House Publishers, US, %22squirts%22+child+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003duKK3-JxxqK\u0026amp;sig\u003dBH_y6RYQz0hQ_gCX1KhFjygJ8eg\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dNhtkUJGAI4_imAWkhYGIDg\u0026amp;redir_esc\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"%22squirts%22%20child%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 66\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"How the child managed to converse and fold at the same time was a marvel, yet the shirt lay in a tidy rectangle by the time she came up for air\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"“Thanks, \u0027\u0027squirt\u0027\u0027.” He winked at her and she giggled\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Female ejaculate\", \"priority\":20}]}, \"synonyms\":{}}");

	add("squish", "{\"term\":\"squish\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old provençal (to 1500)\"], \"text\":\"Apparently an alteration of \u0027squash\u0027 influenced by obsolete \u0027squiss\u0027 (to squeeze) Cognate with Scots \u0027squische\u0027 \u0027squies\u0027 (to crush, squeeze) Compare also Old provençal (to 1500) \u0027esquichar\u0027 (to squeeze, squish) See also squeeze.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The sound or action of something, especially something moist, being squeezed or crushed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A political moderate (term used by conservative activists in the 1980s\", \"priority\":2}]}, \"synonyms\":{}}");

