	add("squush", "{\"term\":\"squush\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A squashing or squelching sound\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1949\u0027\u0027, William Beebe, \u0027High Jungle\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A few yards downstream was a stretch of sloping rock and moss, and here all clamor ceased: only the close-placed ear could detect the muffled \u0027\u0027squush\", \"priority\":3}]}, \"synonyms\":{}}");

